import React, { Component } from 'react';
import BootstrapTable from 'react-bootstrap-table-next';

const products = [];

const columns = [{
  dataField: 'id',
  text: 'Product ID'
}, {
  dataField: 'name',
  text: 'Product Name'
}, {
  dataField: 'price',
  text: 'Product Price'
}];

class App extends React.Component {

render(){    

return(<BootstrapTable keyField='id' data={ products } columns={ columns } />);

}
};

export default App;
